import React from 'react';

const ListItems=()=>{
    const listStyle = {
        color: 'yellow'
    }
    return(
        <div>
            <li style={listStyle}>Data 1</li>
            <li>Data 2</li>
            <li>Data 3</li>
            <li>Data 4</li>
        </div>
    )
};

export default ListItems;
